import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import sample from './sample.jpg'

const partners = [
  {
    img:  sample,
    alt: ''
  },
  {
    img: sample,
    alt: ''
  },
  {
    img: sample,
    alt: ''
  },
  {
    img: sample,
    alt: ''
  },
  {
    img: sample,
    alt: ''
  }
];

const settings = {
  dots: true,
  infinite: true,
  speed: 800,
  slidesToShow: 3,
  slidesToScroll: 1,
  autoplay: true,
  autoplaySpeed: 3000,
  responsive: [
    {
      breakpoint: 1024,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 1,
        infinite: true,
        dots: true
      }
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1
      }
    }
  ]
};

const PartnersSection = () => {
  return (
    <div className="mx-auto max-w-7xl lg:px-0 px-10 pb-10">
      <div className="flex flex-wrap justify-start items-center -mx-4">
        <div className="w-full md:w-1/2 px-4 mb-4 md:mb-0">
          <h2 className="text-3xl dark:text-blacktext-primary lg:text-4xl my-6 font-bold lg:py-0">
            Our Partners
          </h2>
        </div>
      </div>

      <Slider {...settings}>
        {partners.map((partner, index) => (
          <div key={index} className="item">
            <div className="border-2 rounded-lg border-gray-200 bg-white p-4 text-center hover:border-black">
              <img src={partner.img} className="h-28 object-contain mx-auto" alt={partner.alt} />
            </div>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default PartnersSection;
